import React, { Component } from "react";

class TechnicalStuff extends Component {
  state = {};
  render() {
    return (
      <div>
        <p className="comment">
          // the technical stuff
          -----------------------------------------------------------------------------------------
        </p>
      </div>
    );
  }
}

export default TechnicalStuff;
